// Home.js
import React from 'react';
import './Home.css';


function Home() {
  return (
    
    <div className="home-content">
      <div class="col-sm d-flex justify-content-center ">
        <img src="assets/img/logo.png" width="480" height="250" style="margin-top: 10%;" />
      </div>
      <div className="text-section">
        <p>
          <strong>B</strong>ienvenue à <strong style={{ color: '#4ECDC4' }}>نبض التطوع</strong> . <br />
          Cette plateforme réunit ceux qui veulent donner de leur temps <br /> et ceux qui ont besoin de soutien. <br />
          Ensemble, faisons une réelle différence dans nos communautés.
        </p>
      </div>
    </div>
  );
}

export default Home;
